import React from 'react';
//import ReactDOM from 'react-dom';
import 'bulma/css/bulma.css'


const style = {
    width: '70%',
    marginLeft:'10px',
    marginRight:'10px'
}
const divStyle = {
    marginTop:'10px',
    marginBottom:'10px'
}

const Search = () => {
    return(
        <form>
        <div style={divStyle}><input style={style}  className="input is-rounded search-box" type="text" placeholder="Type the Booking Id"  />
        <a class="button is-primary is-rounded">Search</a></div>
        </form>
    )}

    export default Search;
